import CreateUser_temp from "./components/User/CreateUser_temp";
import ShowUser_temp from "./components/User/ShowUser_temp";
import EditUser_temp from "./components/User/EditUser_temp";
import User_temp from "./components/User/User_temp";
import Header from "./components/Common/Header";
import Home from "./components/Layout/Home";
import URLhdl from "./components/Common/Handler";

const URLs = {
    home: { link: "/", route: Home },
    edit: { link: "/edit/:id", route: EditUser_temp },
    comment: "/comment/:id",
    create: "/create",
    list: "/list",
};

export default function URLhandler() {
    return URLs;
}
